import React from 'react';
import ReactTooltip from 'react-tooltip'


export default function Forms (props)
     {

    
    return (

        <form onSubmit={props.loadWeather}>

        <div className="form-group">
            <input type="text" data-tip="hello world" className="form-control" name="city" placeholder="City Name"/>
        </div>
           
        <div className="form-group">
            <input type="text" data-tip="hello world" className="form-control" name="country" placeholder="ISO Code"/>
        </div>
            
            <input className="btn btn-outline-success btn-lg btn-block" type="submit" value="Submit"/> 

         </form>      
            
                )


    




}
